 Today we are featuring our member Daniele Robinson, Director of Marketing for the Colorado Avalanche!
⁣
After studying Communications at The University of Arizona, @daniele_robinson began working in Partnership Marketing at AEG in Los Angeles & The STAPLES Center. She moved to Denver back in 2013, with her husband where she worked at KSE in the Partnership Marketing department for several years. “In 2018, the twins joined our family and I took some time off in my career to focus on family and home life. In January of 2020, I decided to come back to work and join the Avalanche Marketing Team,” said Daniele. Her favorite part of the job is the collaboration and creativity. She loves being able to plan events & activations for the brand from start to finish and watch them come to life. “Creativity is key and also makes our jobs really fun!”
⁣
Daniele wanted to join the DWSC, to be surrounded by other like-minded women in the city of Denver and network with others including new moms returning to the workforce. “I strive to balance work and family life but we all know how difficult that can be in the sports world. I’d like to connect with others and highlight that being a working parent is not always easy and that we are in this together!
⁣
We are excited to have you and your family join the DWSC family!
⁣
