•
Can’t wait to watch @Mulan with the fam tonight! I grew up watching and loving Mulan because she was one of the only “action” female Asian leads to look up to. It’s going to be so surreal to watch her as a live person and not just an animated one. Representation matters because children will know that they are being seen and heard. Then the  questions, “Do they see me and hear me? Do I exist in their eyes?” would not be asked. ❤️ Seriously so excited for my two little boys and toddler girl to see one of my favorite animated characters come to life❣️My 3 year old Nina yelled, “Awesome!!!” when we watched the trailer. Can’t wait for movie night! 📽🍿 
•
